import { BrowserRouter, Route, Routes } from "react-router-dom";
import Home from "../pages/home/Home";
import HappyStylers from "../pages/happyStylers/HappyStylers";
import Header from "../components/Header";
function Path() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/HappyStylers" element={<HappyStylers />} />
        <Route
          path="*"
          element={
            <div className="background">
              <Header />
              <span>404 Vuelve a Viladecans</span>
            </div>
          }
        />
      </Routes>
    </BrowserRouter>
  );
}
export default Path;
